import React, { Component } from "react";

class QuoteControl extends Component {

  render(){
    const[quote,setQuote]=useState("Work is 10% fun all the times");
    return (
       <button onClick={()=> setQuote("The question isn't who is working anymore.")}>Change Quote</button>
    )
  }

}

export default QuoteControl;
